Wikipedia - In Between Dreams is the third album by singer-songwriter Jack Johnson, released by Brushfire Records in the United States on March 1, 2005 (see 2005 in music). &quot;Banana Pancakes&quot; was written originally by Indian writer/singer Alanna Palladino. As of May 10, 2006, the album had sold 2.1 million copies in the United States

Amazon.com Review By Aidin Vaziri - For a man who gets his biggest kicks surfing the waves and strumming his guitar on a lonely beach in native Hawaii, singer-songwriter Jack Johnson has carved out quite a remarkable career on the mainland. His 2003 album, On and On, debuted at No. 3 on The Billboard 200 and subsequently went platinum on the back of hit single &quot;The Horizon Has Been Defeated.&quot; The follow-up, meanwhile, seems destined to shine even brighter. The drifting chords and soft voice are still in place, only now Johnson's instinct for melody has sharpened alongside his ability to self-edit. These small concessions make third album, In Between Dreams, his most conspicuous, particularly on tracks like the three-minute relationship drama, &quot;Sitting, Waiting, Wishing,&quot; and &quot;Breakdown,&quot; a song he originally recorded for Handsome Boy Modeling School's White People album remade here to reveal its full stripped-down loveliness. Imagine all the coconuts it will buy.

MacKenzie Wilson, All Music Guide - Singer/songwriter Jack Johnson writes songs that just feel good, sticking to an equation that combines his warm, relaxed voice with an acoustic guitar. That cozy formula made him a favorite among American college crowds, so it's no surprise that Johnson sticks with what he does best for his third album, In Between Dreams. Producer Mario Caldato, Jr. is back again, touching up Johnson's summery backdrop for another playful set of songs. The genre-blending charm and sweetness that fueled Brushfire Fairytales and On and On hasn't changed that much, but does it really have to? Johnson, alongside drummer Adam Topol and bassist Merlo Podlewski, makes safe records. While there isn't anything wrong with that, taking a few more risks sonically and lyrically wouldn't work against him. Tender moments such as &quot;If I Could&quot; and &quot;No Other Way&quot; showcase a more reserved side on In Between Dreams. Other highlights include the lullaby-like &quot;Breakdown&quot; and the bossa nova rhythms of &quot;Do You Remember.&quot; Whether he's singing about being in love -- which he does quite well on &quot;Better Together&quot; and &quot;Banana Pancakes&quot; -- or reflecting on its hardships, Johnson's laid-back approach is his biggest strength. In Between Dreams is a bit brighter and more upbeat, but his song remains the same.

